import React, { useState, useEffect } from 'react'

function Home() {
    const [data, setData] = useState([{}]);

    useEffect(() => {
        fetch("/home").then(
            res => res.json()
        ).then(
            data => {
                setData(data)
            }
        )
    }, [])

    return (
        <div>
            <h1>This is the Home page</h1>
        </div>
    )
}

export default Home;
